ul.script:
$(document).ready(function() {
	var searchparam = document.location.search;
	if (searchparam != "") {
		var href= $("#languageLink").attr("href");
		if (href.indexOf("?") == -1) {
			$("[id=languageLink]").attr("href", href + searchparam);
		}
	}
});

section.script:
var sitepathname = window.location.pathname;
if(sitepathname.indexOf('forwardthinking')>=0 || sitepathname.indexOf('aproposdargent')>=0){
	var pn = "forwardthinking";
	var title = "Subscribe";
	if (sitepathname.indexOf('aproposdargent')>=0) {
		pn = "aproposdargent";
		title = "Abonnement";
	}
	var mktDiv = $(".attributes-mkt");
	if (!mktDiv.length) {
		mktDiv = $('
');
		mktDiv.addClass('attributes-mkt');
		mktDiv.attr({
			'data-backgroundimg':'/file_source/fberoot/images/Hero%20images/Hero_Forward_Thinking_1600x333.jpg',
			'data-bannerbutton-url':'/'+pn+'/subscribe/index.html',
			'data-bannerbutton-text':title,
		});	
		$(".banner").first().prepend(mktDiv);
	} else {
		if (typeof mktDiv.attr('data-backgroundimg') === typeof undefined) {
			mktDiv.attr('data-backgroundimg','/file_source/fberoot/images/Hero%20images/Hero_Forward_Thinking_1600x333.jpg');
		}
		if (typeof mktDiv.attr('data-bannerbutton-text') === typeof undefined) {
			mktDiv.attr({
				'data-bannerbutton-url':'/'+pn+'/subscribe/index.html',
				'data-bannerbutton-text':title,
			});	
		}
	}
}
